import '../css/App.css';

const SideNav = ({ list }) => {
	const tabItem = Object.keys(list).map(key => (
		<div class="tab">{list[key]}</div>
	))
	return (
		<footer className="App-sideNav">
			{tabItem}
		</footer>
	);
}

export default SideNav;
